import SearchBar from  "./Search/SearchBar.jsx";

const Nav = ({onSearch}) => {



  return(
    
    <nav className = {style.containerNav}>
        <SearchBar onSearch={onSearch} className = {style.containerSearch}/>
        <ul className = {style.unorderList}>
          <li><a href='facebook.com'>About Us</a></li>
          <li><a href='yputube.com'>Contact Galaxy</a></li>
          <li><a href='youtube.com'>Rick & Morty</a></li>
          <li><a href='instagram.com'>Llamanos</a></li>
        </ul>
    </nav> 
  );

}

export default Nav;
